  \"42.71 \"\n\t},\n\t{\n\t\t\"key\": \"licence\",\n\t\t\"value\": \"[\"Property ownership
  data is compiled from deeds, plats, surveys, and other source data. These are not
  engineering quality drawings and should be used for administrative purposes only.
  The National Park Service shall not be held liable for improper or incorrect use
  of the data described and/or contained herein. These data and related graphics are
  not legal documents and are not intended to be used as such. The information contained
  in these data is dynamic and may change over time. The data are not better than
  the original sources from which they were derived. It is the responsibility of the
  data user to use the data appropriately and consistent within the limitations of
  geospatial data in general and these data in particular. The related graphics are
  intended to aid the data user in acquiring relevant data; it is not appropriate
  to use the related graphics as data. The National Park Service gives no warranty,
  expressed or implied, as to the accuracy, reliability, or completeness of these
  data. It is strongly recommended that these data are directly acquired from an NPS
  server and not indirectly through other sources which may have changed the data
  in some way. Although these data have been processed successfully on a computer
  system at the National Park Service, no warranty expressed or implied is made regarding
  the utility of the data on another system or for general or scientific purposes,
  nor shall the act of distribution constitute any such warranty. This disclaimer
  applies both to individual use of the data and aggregate use with other data.\"]\"\n\t},\n\t{\n\t\t\"key\":
